import { Switch, Route } from 'react-router-dom';

import NiveisPage from './pages/NiveisPage';
import DesenvolvedoresPage from './pages/DesenvolvedoresPage';

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/niveis" component={NiveisPage} />
        <Route path="/desenvolvedores" component={DesenvolvedoresPage} />
      </Switch>
    </Router>
  );
}

export default App;
